import React from 'react';
import { GoogleMap, LoadScript } from '@react-google-maps/api';

const containerStyle = {
  width: '95vw',
  height: '75vh',
  margin: '3vh',
};

const center = {
  lat: 45.397,
  lng: -84.644
};

function MapComponent({ onClick }) {
  return (
    <LoadScript
      googleMapsApiKey={""}
      loadingElement={<div>Loading...</div>}
      preventGoogleFontsLoading={true}  // Optional: Prevents loading of Google fonts
    >
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={10}
        onClick={onClick}
      >
        {/* Additional Map Content Here */}
      </GoogleMap>
    </LoadScript>
  );
}

export default React.memo(MapComponent);
